css:
@import url(http://fonts.googleapis.com/css?family=Comfortaa);

.keylabel {
    font-family: 'Lato';
    letter-spacing: 1px;
    display: flex;
    flex-direction: row;
    align-items: center;
    justify-content:center;
    /*border: 0.5px solid orange;*/
    position: absolute;
    top:0 !important ;
    right:0;
    bottom:0;
    left:0;
    width: 100% !important;
    height: 100% !important;
    max-height: 100% !important;
    padding: 2px;
    margin-top:0;
}

.keylabel > div {
    display: flex;
    align-items: center;
    justify-content: center;
    width: auto !important;
    height: auto !important;
}

.keylabel0 {
    color: #fff !important;
    opacity:1.0;
    font-size: 13px !important;
    padding-bottom: 27px;
    padding-right: 28px;
}

/*Center Center*/
.keylabel4 {
    font-size: 13px !important;
    justify-content: flex-start;
    padding-left:4px;
}

/*Front Left, used for centered small mod text*/
.keylabel9 {
    font-size: 9px !important;
    max-height: 100% !important;
}

/*Center Top*/
.keylabel1 {
    font-size: 14px !important;
    align-items: flex-start;
    justify-content: flex-start;
    padding-top:7px;
    padding-left:5px;
}

/*Center Bottom*/
.keylabel7 {
    font-size: 14px !important;
    align-items: flex-end;
    justify-content: flex-start;
    padding-bottom:7px;
    padding-left: 5px;
}

/*bottom right*/
.keylabel8 {
    color: #00F0FF !important;
    font-size: 8px !important;
    align-items: flex-end;
    justify-content: flex-end;
    opacity:0.5;
    padding-bottom:4px;
}

/* factually the label in the middle */
.keylabel9 {
    font-size: 15px !important;
}

.keyborder {
    transform: scaleY(0.92) scaleX(0.92);
    border-width: 0px !important;
    box-shadow: 0 2px 2px rgba(0,0,0,0.2);
}

.keytop {
    border-radius: 5px !important;
    transform: scaleX(1.03) translateY(-1px);
    border-width: 1.5px;
    border-color: rgba(255,255,225,0.07) !important;
    box-shadow: 0 1px 2px rgba(0,0,0,0.4);

}

/*Front Edge Centered*/
.keylabel10 {
    color: #F90396 !important;
    font-size: 10px !important;
    align-items: flex-end;
    justify-content: center;
    padding-bottom: 0px;
    opacity:0.8;
    transform: translateY(12px) scaleY(0.7);
}

/*Top Right*/
.keylabel2 {
    color: #FF9900 !important;
    font-size: 8px !important;
    line-height: 8px !important;
    align-items: flex-start;
    justify-content: flex-end;
    padding-top:4px;
    opacity:0.7;
    padding-right:0px;
    letter-spacing: 0.5px;
}
